INSERT INTO `CATALOGUE` VALUES (247747,'Amar Akbar Anthony','Movie',1977,'TV-14',172,'Abandoned in a park by their father, Amar, Akbar and Anthony grow up independently and have no knowledge of one another. They\'re reunited as adults when, by coincidence, they all give blood at the same hospital.','2019-12-31 00:00:00'),(269880,'Bad Boys','Movie',1995,'R',119,'In this fast-paced actioner, two Miami narcotics cops are hot on the trail of a master crook who has snatched $100 million worth of heroin.','2019-10-01 00:00:00'),(281550,'La Bamba','Movie',1987,'PG-13',109,'The plane crash that killed Buddy Holly also took Ritchie Valens, whose modest upbringing and rise to fame are depicted in this exhilarating biopic.','2020-01-01 00:00:00'),(284890,'Barsaat','Movie',1995,'TV-PG',166,'A naïve young man and a rich city girl fall in love. Her stepfather, however, doesn\'t approve of the match and will stop at nothing to split the pair.','2018-04-01 00:00:00'),(292118,'Beavis and Butt-head Do America','Movie',1996,'PG-13',81,'After realizing that their boob tube is gone, Beavis and Butt-head set off on an expedition that takes them from Las Vegas to the nation\'s capital.','2019-11-20 00:00:00'),(296682,'Benji','Movie',1974,'G',86,'After lovable abandoned mutt Benji is adopted by a kind family, he chases cats, flirts with a show dog and bravely helps to rescue two abducted kids.','2018-03-06 00:00:00'),(347365,'Candyman','Movie',1992,'R',99,'Grad student Helen Lyle unintentionally summons the Candyman, a hook-handed creature made flesh by other people\'s belief in him.','2019-10-01 00:00:00'),(352989,'Carrie','Movie',1976,'R',98,'An outcast teen with telekinetic ability lashes out with her deadly power when the high school \"in crowd\" torments her with a sick joke at the prom.','2019-06-01 00:00:00'),(372195,'Child\'s Play','Movie',1988,'R',87,'When a rash of murders unfolds, 6-year-old Andy knows that his toy doll Chucky is the killer, but neither his mom nor the cops believe him.','2019-12-31 00:00:00'),(374651,'Chitty Chitty Bang Bang','Movie',1968,'G',146,'Quirky inventor Caractacus Potts and his family travel in their magical flying car to Vulgaria, a kingdom strangely devoid of children.','2020-01-01 00:00:00'),(382650,'Cleopatra Jones','Movie',1973,'PG',89,'A stylin\' special agent chases down drug lords and does her part to stop trafficking. Soon, she finds herself seeking revenge on a dealer.','2019-11-01 00:00:00'),(404067,'The Craft','Movie',1996,'R',101,'At a Catholic school, a new girl falls in with a clique of teen witches who wield their powers against anyone who crosses them, even their parents.','2020-01-01 00:00:00'),(408911,'The Crow','Movie',1994,'R',102,'One year after Eric Draven and his fiancée are murdered, Draven – watched over by a hypnotic crow – returns from the grave to exact revenge.','2019-01-01 00:00:00'),(419733,'The Dark Crystal','Movie',1982,'PG',93,'In this mythical tale, Jen, the last of the Gelfling race, is charged with healing the Crystal of Truth after its mutilation sets off an era of terror.','2019-05-01 00:00:00'),(449931,'Doctor Zhivago','Movie',1965,'PG-13',200,'A young physician and his beautiful mistress get swept up in the danger and drama of the Bolshevik Revolution in this Oscar-winning epic.','2019-11-01 00:00:00'),(484369,'The Evil Dead','Movie',1981,'TV-MA',85,'During a stop at a remote cabin deep within the woods, a group of teens begins turning into flesh-eating zombies in director Sam Raimi\'s cult classic.','2020-01-10 00:00:00'),(485218,'Executive Decision','Movie',1996,'R',133,'When terrorists hijack a 747 and turn it into a nerve gas bomb aimed at Washington, D.C., commandos use an experimental plane to try to stop them.','2019-11-01 00:00:00'),(498716,'Ferris Bueller\'s Day Off','Movie',1986,'PG-13',103,'Ferris convinces his entire school he\'s at death\'s door, then hits the streets of Chicago with his girlfriend and best friend for a day of fun.','2020-01-03 00:00:00'),(506464,'The First Wives Club','Movie',1996,'PG',103,'Following a friend\'s suicide after her husband dumps her for a younger model, three women plot payback against their two-timing exes.','2019-11-20 00:00:00'),(510854,'The Flintstones','Movie',1994,'PG',91,'The Flintstones hit the big screen in this live-action comedy that finds Fred and Barney struggling to cope with the pressures of work and family.','2019-10-01 00:00:00'),(516154,'For the Love of Benji','Movie',1977,'G',84,'Benji and his owner get separated in Greece. On his quest to find them, he\'s targeted by various bad guys who want to get their hands on him.','2018-03-06 00:00:00'),(516788,'Forbidden Planet','Movie',1956,'G',98,'A pulp-fiction sci-fi classic, Forbidden Planet stars Leslie Nielsen as a heroic starship captain who finds the paradise planet Altair-IV.','2019-11-01 00:00:00'),(520489,'Four Weddings and a Funeral','Movie',1994,'R',118,'A commitment-phobic Brit tries to reconnect with an alluring American who\'s about to make a seemingly awful mistake by marrying a wealthy, boring man.','2019-08-01 00:00:00'),(523650,'Free Willy','Movie',1993,'PG',112,'Ordered to clean up the graffiti he painted at a marine theme park, a troubled young boy unexpectedly bonds with a killer whale on exhibit.','2020-01-01 00:00:00'),(542137,'Gigi','Movie',1958,'G',115,'Gigi\'s an avant-garde French waif being groomed as the fille de joie of affluent and handsome Gaston. Soon Gigi metamorphoses into a stunning beauty.','2019-11-01 00:00:00'),(569355,'Hamburger Hill','Movie',1987,'R',110,'The Vietnam War\'s horrors come brutally to life through the eyes of American soldiers trying to take a heavily fortified hill under Vietcong control.','2019-11-23 00:00:00'),(607931,'How to Make an American Quilt','Movie',1995,'PG-13',116,'A conflicted young woman spends the summer with her grandmother, her great-aunt and their quilting circle, whose life stories captivate her.','2018-04-01 00:00:00'),(653673,'Jimi Hendrix','Movie',1973,'R',102,'Jimi Hendrix\'s family, friends, and fellow musicians discuss his life and influence. Hendrix also appears in classic performance footage.','2019-11-01 00:00:00'),(673843,'Kingpin','Movie',1996,'PG-13',114,'After a bowler loses his hand, his career takes a nosedive. That is, until he uncovers the next big thing: an Amish kid named Ishmael.','2020-01-01 00:00:00'),(684847,'The Last Boy Scout','Movie',1991,'R',105,'Private eye Joe Hallenbeck is forced to team up with a disgraced quarterback to uncover a conspiracy by a politician and a football team owner.','2019-11-01 00:00:00'),(699257,'Monty Python\'s Life of Brian','Movie',1979,'R',94,'Born in a stable in Judea, Brian grows up to join a group of anti-Roman zealots, but his fate keeps getting confused with that of a certain carpenter.','2018-10-02 00:00:00'),(701346,'Like Water for Chocolate','Movie',1992,'R',105,'When Pedro marries her sister, Tita throws herself into her cooking – and discovers she can transfer her emotions through the food she prepares.','2019-11-01 00:00:00'),(709163,'Logan\'s Run','Movie',1976,'PG',118,'In the 23rd century, inhabitants of a domed city exist in a world filled with life\'s pleasures – but no one is allowed to live past the age of 30.','2019-11-01 00:00:00'),(709380,'Lolita','Movie',1962,'R',153,'In this black comedy, an English professor marries his landlady to get closer to his forbidden obsession: her teenage daughter.','2019-11-01 00:00:00'),(771476,'Monty Python and the Holy Grail','Movie',1975,'PG',92,'The Monty Python comedy clan skewers King Arthur and his Knights of the Round Table as they quest far and wide for the Holy Grail.','2019-01-02 00:00:00'),(786137,'My Girl','Movie',1991,'PG-13',102,'This coming-of-age charmer follows a summer in the life of an 11-year-old girl who learns about love and loss as she grapples with profound changes.','2020-01-01 00:00:00'),(793907,'The Natural','Movie',1984,'PG',138,'A gifted baseball player whose life has taken so